oxy_webhelp_navlinks = {"app_adv.dita-d4800e3711":{"topics":[{"title":"Which Notes files should be backed up?","shortdesc":"<p class=\"shortdesc\">You may want to back up and later restore particular HCL Notes® applications and files. <\/p>","href":"app_important_files_to_backup_r.html","attributes":{"data-id":"app_important_files_to_backup_r"},"menu":{"hasChildren":false},"tocID":"app_important_files_to_backup_r-d4800e3722","topics":[]},{"title":"How do I use XPage applications in Notes?","shortdesc":"<p class=\"shortdesc\">You can run XPage applications in HCL Notes®.<\/p>","href":"app_use_xpage_apps_t.html","attributes":{"data-id":"app_use_xpage_apps"},"menu":{"hasChildren":false},"tocID":"app_use_xpage_apps-d4800e3736","topics":[]},{"title":"Subscribing to Notes applications","shortdesc":"<p class=\"shortdesc\">Subscriptions allow you to receive real-time updated information from your favorite HCL Notes® applications. A subscription is a results document that displays the information you choose to monitor in a specified Notes application. For example, you have a New Mail subscription set up in Headlines that, when enabled, notifies you when you have new mail.<\/p>","href":"app_subscribing_to_notesapps_t.html","attributes":{"data-id":"app_subscribing_to_notesapps_t"},"menu":{"hasChildren":true},"tocID":"app_subscribing_to_notesapps_t-d4800e3750","next":"app_subscribing_to_notesapps_t-d4800e3750"}]}};